import React from 'react';
import { useRouter } from 'next/router';

class Auth extends React.Component {

  constructor(props) {
    super(props);
    console.log('authenticate constructor');
  }

  componentDidMount() {
    this.router = useRouter();
  }



  render() {
    return (
      <div>
        {(this.router.query.code)}
      </div>
    );
  }
}

export default Auth;
